import React from "react";


const Item = ({prods}) => {
 
  return (
    <>
    <div>
        <h1 key={index}>{prods.Nombre}</h1>
        <h1 key={index}>{prods.Descripcion}</h1>
        <h1 key={index}>{prods.Stock}</h1>
        <h1 key={index}>{prods.boton}</h1>
        </div>
    </>
  );
}; 

export default Item;
